// App.js
import React, { Component } from 'react';
import './App.css';
import UsuarioEntrada from './UsuarioEntrada';
import UsuarioSaida from './UsuarioSaida';

class App extends Component {
  state = {
    username: 'Larissa Machado via Props',
    typedUsername: '', 
  };

  handleUsernameChange = (event) => {
    this.setState({ typedUsername: event.target.value });
  };

  render() {
    return (
      <div className="App">
        <UsuarioEntrada onChange={this.handleUsernameChange} />
        <UsuarioSaida
          username={this.state.username}
          typedUsername={this.state.typedUsername}
        />
      </div>
    );
  }
}

export default App;
